import Vue from 'vue'
import App from './App.vue'
import router from './router'
import MyHeader from './components/MyHeader.vue'
import MyFooter from './components/MyFooter.vue'
import ToolBars from './components/ToolBars.vue'
import Bread from './components/Bread.vue'
import * as filters  from './assets/js/filters.js'
// 全局注册过滤器
Object.keys(filters).forEach(key => {
  Vue.filter(key, filters[key])
 });

// $router.push 解决重复路由问题
import Router from 'vue-router'
 
const originalPush = Router.prototype.push
Router.prototype.push = function push(location) {
  return originalPush.call(this, location).catch(err => err)
}

// vue-awesome-swiper
import VueAwesomeSwiper from 'vue-awesome-swiper'
import 'swiper/dist/css/swiper.css'
// 引入axios
import axios from 'axios'
// 请求的基础路径
axios.defaults.baseURL="http://127.0.0.1:5050/";
// 请求时保存session信息
axios.defaults.withCredentials=true;
Vue.prototype.axios=axios;

import QS from 'qs'
Vue.prototype.QS=QS;
import Vuex from 'vuex'
// Vue.config.productionTip = false
Vue.component("my-header",MyHeader);
Vue.component("my-footer",MyFooter);
Vue.component("tool-bars",ToolBars);
Vue.component("bread",Bread);
Vue.use(VueAwesomeSwiper);
Vue.use(Vuex);
// 创建存储对象
const store=new Vuex.Store({
  state:{
// 保存数据
    // 购物车数据数组
    cartData:[],
    // 购物车商品数量
    cartCount:0
  },
  mutations:{
// 修改

  },
  getters:{
// 获取
    getstorageCart(state){
      return JSON.parse(localStorage.getItem("cartProducts"));
    },
    getCount(state){
      return JSON.parse(localStorage.getItem("cartProducts")).length;
    }
  },
  actions:{
// 异步修改
  }
});
new Vue({
  router,
  store,
  render: h => h(App)
}).$mount('#app')
